import React from 'react';
import { Menu, Row } from 'antd';
import { LoginOutlined, UnorderedListOutlined, CloudOutlined, DollarCircleOutlined } from '@ant-design/icons';
import { useNavigate } from 'react-router-dom';
import { routeNames } from '../../router';

const Navbar = () => {
    const navigate = useNavigate();

    return (
        <Row justify="end">
            <Menu mode="horizontal" selectable={false}>
                <Menu.Item onClick={() => navigate(routeNames.LOGIN)} key="login" icon={<LoginOutlined />}>
                    Login
                </Menu.Item>
                <Menu.Item onClick={() => navigate(routeNames.MAINPAGE)} key="main" icon={<UnorderedListOutlined />}>
                    Main
                </Menu.Item>
                <Menu.Item onClick={() => navigate(routeNames.WEATHER)} key="weather" icon={<CloudOutlined />}>
                    Weather
                </Menu.Item>
                <Menu.Item onClick={() => navigate(routeNames.CURRENCY)} key="currency" icon={<DollarCircleOutlined />}>
                    Currency
                </Menu.Item>
            </Menu>
        </Row>
    );
};

export default Navbar;
